pragma solidity ^0.4.24;
pragma experimental ABIEncoderV2;

import "./strings.sol";
import "./bytesUtil.sol";
import "./intUtil.sol";
import "./signatureShape.sol";

contract Mp4DataInterface1 is SignatureShape{
    function getSignatures() public view returns (Signature[] memory);
}

contract Mp4DataInterface2 is SignatureShape{
   function getSignatures() public view returns (Signature[] memory);
}

contract Mp4DataInterface3 is SignatureShape{
   function getSignatures() public view returns (Signature[] memory);
}

contract Mp4DataInterface4 is SignatureShape{
   function getSignatures() public view returns (Signature[] memory);
}

contract Mp4DataInterface5 is SignatureShape{
   function getSignatures() public view returns (Signature[] memory);
}

contract Mp4SignatureDB is SignatureShape {

    using Strings for *;
    using BytesUtil for *;
    using IntUtil for *;

    Mp4DataInterface1 mp4Contract1 = Mp4DataInterface1(0xcf6dfaa0b81bb31f1d4d8b922e4f733289fe7156);
    Mp4DataInterface2 mp4Contract2 = Mp4DataInterface2(0xbab8e44ed18214d9def8403503711b4deca7cb86);
    Mp4DataInterface3 mp4Contract3 = Mp4DataInterface3(0x268a2fe76428295f5248bf80eceb456847f57e89);
    Mp4DataInterface4 mp4Contract4 = Mp4DataInterface4(0xef1d404ff4a59c30c662cb23200b0bcd8ca09191);
    Mp4DataInterface5 mp4Contract5 = Mp4DataInterface5(0x032fa4265419df11578f024896ccf7d28ca27c1c);

    function getSignatures() public view returns (Signature[] memory){
        Signature[][5] memory sigsEach = [mp4Contract1.getSignatures(), mp4Contract2.getSignatures(), mp4Contract2.getSignatures(), mp4Contract2.getSignatures(), mp4Contract2.getSignatures()];

        uint len = 0;
        for(uint i = 0; i < sigsEach.length; i++){
            len += sigsEach[i].length;
        }
        Signature[] memory sigsAll = new Signature[](len);

        for(i = 0; i < 5; i++){
            for(uint j = 0; j < sigsEach[i].length; j++){
                sigsAll[i * 8 + j] = sigsEach[i][j];
            }
        }

        return sigsAll;
    }


}
